import React, {} from 'react';

import Chat from './Container/Chat/Chat';

const Channel = ({ channel, users, name, messages }) => {
  console.log('messages', messages);
  console.log('users', users);
  return (
    <div>
      {name}
      <Chat
        messages={messages}
      />
    </div>
  );
};

export default Channel;
